#         "beneficiamento_sementes": {
#             0: " Os frutos devem ser colhidos diretamente da árvore quando iniciarem abertura espontânea .",
#             1: " Os frutos devem ser colhidos diretamente da árvore quando iniciarem a abertura espontânea. Em seguida devem ser deixados em local arejado para completar a abertura e a liberação de sementes.",
#             2: " Os frutos devem ser colhidos diretamente da árvore quando iniciarem a abertura espontânea. Em seguida devem ser deixados em local arejado para completar a abertura e a liberação de sementes.",
#             3: " Os frutos devem ser colhidos diretamente da árvore quando iniciarem a abertura espontânea. Em seguida devem ser deixados em local arejado para completar a abertura e a liberação de sementes.",
#             4: " Os frutos devem ser colhidos diretamente da árvore quando iniciarem a abertura espontânea. Em seguida devem ser deixados em local arejado para completar a abertura e a liberação de sementes.",
#             5: " Os frutos devem ser colhidos diretamente da árvore, quando iniciar a queda espontânea, ou recolher do chão após a queda. Deixar amontoado em um saco plástico até o apodrecimento parcial da polpa. Lavar os frutos em água corrente.",
#             6: " frutos colhidos quando se desprendem facilmente do pedúnculo, ou após cairem no chão. Reprodução assexuada: mergulhia de cepa, alporquia, enxertia, estaquia e micropropagação.",
#             7: " Coleta de infrutescências (flores secas) com foice de mão. Observe que nas inflorescências maduras há sementes dispersando (saindo naturalmente das flores secas com o vento). Passe as inflorescências em peneira fina para separar as sementes. É possível usar ensiladeira.",
#             8: " Colher os frutos no chão quando iniciarem a queda espontânea. Abrir os frutos manualmente com facão ou ferramenta específica para retirada da castanha.",
#             9: " Colher frutos maduros e deixar secar até perceber que a semente esta solta no caroço. Despolpar e semear. Em condições naturais, as sementes podem levar de um a dois anos para germinar. No entanto, quando submetidas a escarificação e acondicionadas a temperatura superior a 35ºC podem germinar entre quatro e seis meses. A Universidade Federal de Viçosa desenvolveu uma técnica que possibilita taxa de germinação de 60 - 80%.",
#             10: " Colher as inflorescências manualmente quando estiverem secas. Passar em máquina trituradora de palha (ensiladeira) para desagregação das sementes.",
#             11: " Possui dormência, recomenda-se escarificação com lixa fina na região oposta a micrópila.",
#             12: "Sem esse dado.",
#             13: " Possui dormência, recomenda-se escarificação com lixa fina na região oposta a micrópila.",
#             14: " Colher os frutos diretamente da árvore quando maduros. Os frutos assim obtidos podem ser diretamente utilizados para o plantio como se fossem sementes; não havendo necessidade de despolpá-los.",
#             15: " Colher os frutos diretamente da árvore quando adquirirem a coloração vermelha. Em seguida deixá-los amontoados em saco plástico até a decomposição parcial da polpa para facilitar a remoção das sementes através da lavagem em água corrente.",
#             16: " Os frutos devem ser colhidos diretamente da árvore quando iniciarem a abertura espontânea, deixando secar à sombra sobre lona até completar a abertura e liberação das minúsculas sementes.",
#             17: " Colher os frutos diretamente da árvore quando iniciarem a queda espontânea ou recolhê-los no chão logo após a queda. Em seguida deixá-los amontoados em saco plástico até a decomposiçãoparcial da polpa para facilitar a remoção da semente através da lavagem em água corrente dentro de uma peneira.",
#             18: " As vagens maduras devem ser colhidas diretamente da árvore antes da abertura natural. Em seguida, devem ser expostas ao sol para secar, o que facilita a abertura dos frutos e a liberação das sementes.",
#             19: " As vagens maduras devem ser colhidas diretamente da árvore antes da abertura natural. Em seguida, devem ser expostas ao sol para secar, o que facilita a abertura dos frutos e a liberação das sementes.",
#             20: " Deixar os frutos secarem ao sol para completarem a abertura e liberação das sementes.",
#             21: " Os frutos devem ser colhidos diretamente da árvore ao iniciarem a abertura espontânea. O que é facilmente notado pela exposição do arilo vermelho-vivo que envolve a semente. Em seguida, os frutos devem ser expostos ao sol para completar a abertura e liberação das sementes. Não há necessidade de retirar o arilo da semente, mas apenas deixá-lo secar.",
#             22: " Colher frutos diretamente da árvore quando iniciarem a abertura espontânea; o que é facilmente notado pela exposição do arilo vermelho vivo que envolve as sementes. Em seguida levá-los para o sol para completar a abertura e liberação das sementes. Não há necessidade de retirar o arilo das sementes; apenas deixá-lo secar.",
#             23: " Colher quando as inflorescências estiverem secas. O uso de ensiladeira pode ajudar na colheita.",
#             24: " Colher os frutos no chão quando iniciarem a queda espontânea. Em seguinda, abrir manualmente para retirada da semente única.",
#             25: " Os frutos devem ser colhidos diretamente da árvore quando iniciarem a queda espontânea (coloração escura do fruto), ou recolhidos no chão. Em seguida deixá-los amontoados em saco plástico até o apodrecimento parcial de sua polpa para facilitar a separação das sementes através da lavagem em água corrente.",
#             26: " Colher os frutos diretamente da árvore quando maduros. Em seguida, despolpar manualmente em água corrente com peneira, deixando-se as sementes secarem a sombra para posterior semeadura.",
#             27: " Colher os frutos (cápsula) diretamente da árvore quando iniciarem a abertura espontânea. Em seguida, deixá-los ao sol para completarem sua abertura e a liberação das sementes.",
#             28: " Os frutos devem ser colhidos quando adquirirem coloração avermelhada. Em seguida devem ser macerados e despolpados em água corrente.",
#             29: " reproduz-se por estaquia. Lentidão na propagação por sementes.",
#             30: " Colher as inflorescências inteiras logo após a secagem das flores, quando os frutos caem facilmente a um leve toque. Em seguida bater o material colhido em lona plática e separar os peduncúlos. Devido ao pequeno peso das sementes, protegê-las do vento durante seu preparo.",
#             31: " Colher os frutos diretamente da árvore antes da abertura natural. Em seguida, devem ser deixadas para secar à sombra sobre lona e sob tela fina, o que ajuda a evitar a perda de sementes.",
#             32: ' Colher frutos diretamente da árvore, quando iniciar a queda espontânea, ou recolhê-los no chão, após a queda. Secar frutos ao sol; separar "asas" para semear.',
#             33: " O verdadeiro fruto (castanha) deve ser colhido diretamente da árvore ou no chão quando iniciarem a queda espontânea. Separar a castanha da parte suculenta (pseudofruto). Antes de semear recomenda-se deixar as castanhas em repouso dentro da água durante 48h, trocando-se a água a cada 8h. A castanha assim preparada está pronta para ser semeada.",
#             34: " O verdadeiro fruto (castanha) deve ser colhido diretamente da árvore; separando-se a castanha da parte suculenta (pseudofruto). A castanha assim preparada está pronta para ser semeada.",
#             35: " Os frutos completos (peduncúlo e castanha) devem ser colhidos diretamente da árvore, separando-se a castanha (verdadeiro fruto) da parte suculenta (pseudofruto). A castanha assim separada está pronta para ser semeada.",
#             36: " Os frutos devem ser coletados após início da abertura espontânea, quando começa a disseminação das sementes. Em seguida, devem ser levados ao sol para para completar a abertura e liberação das sementes.",
#             37: " Os frutos devem ser coletados após início da abertura espontânea, quando começa a disseminação das sementes. Em seguida, devem ser levados ao sol para para completar a abertura e liberação das sementes.",
#             38: " Os frutos devem ser coletados após início da abertura espontânea, quando começa a disseminação das sementes. Em seguida, devem ser postos em ambiente ventilado, para a deiscência.",
#             39: " Os frutos quando obtidos podem ser diretamente utilizados para a semeadura. Não há necessidade da retirada do pericarpo.",
#             40: " Os frutos quando obtidos podem ser diretamente utilizados para a semeadura. Não há necessidade da retirada do pericarpo.",
#             41: " Colher os frutos diretamente da árvore quando iniciarem a queda espontânea ou recolhê-los no chão após a queda. Estes já podem ser considerados como semente para fins de semeadura (Lorenzi, 1998b).",
#             42: " Coleta dos pendões com foice de mão. Observar que as sementes devem estar dispersando (soltando naturalmente dos pendões). Os pendões são passados em máquina trituradora de palha (ensiladeira) para desagregação das sementes.",
#             43: " Coleta dos pendões com foice de mão. Observar que as sementes devem estar dispersando (soltando naturalmente dos pendões). Os pendões são passados em máquina trituradora de palha (ensiladeira) para desagregação das sementes.",
#             44: "Sem esse dado.",
#             45: " Coleta dos pendões com foice de mão. Observar que as sementes devem estar dispersando (soltando naturalmente dos pendões). Os pendões são passados em máquina trituradora de palha (ensiladeira) para desagregação das sementes.",
#             46: " Coleta dos pendões com foice de mão. Observar que as sementes devem estar dispersando (soltando naturalmente dos pendões). Os pendões são passados em máquina trituradora de palha (ensiladeira) para desagregação das sementes.",
#             47: " Coleta dos pendões com foice de mão. Observar que as sementes devem estar dispersando (soltando naturalmente dos pendões). Os pendões são passados em máquina trituradora de palha (ensiladeira) para desagregação das sementes.",
#             48: " Colher os frutos diretamente na árvore quando maduros. Deixar os frutos durante alguns dias em saco plástico para decomposição parcial da polpa e despolpar com o auxilio de água corrente e peneira para obtenção das sementes.",
#             49: " Colher os frutos diretamente da árvore quando iniciarem a queda espontânea, ou recolhê-los no chão após a queda. Em seguida despolpá-los manualmente sob água corrente dentro de uma peneira, deixando-se as sementes secar na sombra. Plantar em seguida.",
#             50: " Colher os frutos diretamente na árvore quando maduros, deixá-los alguns dias amontoados para iniciar o apodrecimento da polpa e facilitar a remoção das sementes através do esfregaço manual em água corrente dentro de uma peneira.",
#             51: " Coletar frutos maduros e deixa-los em água por 24 hrs , depois esfregar em peneira com areia para retirada de polpa e separação de sementes. Em seguida lavar as sementes em água corrente e colocá-las para secar em local sombreado e ventilado. Após secagem as sementes estão prontas para serem semeadas.",
