#             118: " Os frutos devem ser colhidos diretamente da árvore ou no chão quando maduros. Em seguida, deixá-los amontoados em saco plástico até o apodrecimento parcial da polpa. Remover as sementes com o auxilio de água corrente na peneira fina e deixá-las secar em ambiente arejado à sombra. Para plantio imediato também pode-se semear diretamente as sementes em suspensão aquosa.",
