#             120: " Coleta de infrutescências (flores secas) com uso de foice de mão. Observe que nas inflorescências maduras há sementes dispersando (saindo naturalmente das flores secas com o vento). Passar as flores secas em peneiras para separar as sementes.",
#             121: " Colher os frutos diretamente da planta quando iniciarem a abertura espontânea. Em seguida deixá-los ao sol para complementar sua abertura e a liberação das sementes; como estas não soltam facilmente; devem ser removidas manualmente batendo-se nos frutos dentro de sacos, com uma vara.",
#             122: " Colher os frutos diretamente na árvore quando apresentarem coloração vermelha. Depois, despolpar manualmente em água corrente com auxílio de peneira com malha apropriada com cuidado para não danificar as sementes, que são frágeis.",
#             123: " Colher os frutos diretamente da árvore quando iniciarem a queda espontânea e os frutos estiverem bem secos e com coloração opaca. Em seguida descascar manualmente os frutos para a separação das sementes e sua escarificação leve.",
#             124: " Os frutos devem ser colhidos diretamente da árvore, quando iniciarem a queda espontânea. Em seguida, devem ser expostos ao sol, para secar, o que facilitará a abertura e a retirada das sementes. Recomenda-se que os frutos sejam colocados em saco de algodão e batidos com martelo de borracha, devendo-se retirar os resíduos em seguida. Pode-se também semear as pequenas vagens inteiras, como se fossem sementes, mas isso pode resultar em mudas defeituosas.",
#             125: " Colher os frutos diretamente da planta quando estiverem maduros (amarelos). Em seguida despolpá-los manualmente sob água corrente dentro de uma peneira, deixando as sementes secarem na sombra. Semear em seguida.",
