#             129: " Os frutos deverão ser colhidos diretamente da árvore quando maduros. Depois, estes deverão ser colocados em local sombreado pra completar a maturação e facilitar a retirada manual da semente com auxilio da peneira em agua corrente. Deixar secar um pouco à sombra.",
