#             131: " O s frutos deverão ser colhidos diretamente da árvore quando apresentarem cor amarelada e iniciar a queda espontânea ou mesmo serem recolhidos diretamente do chão. Coletados os frutos, estes deverão ser colocados em local sombreado pra completar a maturação e facilitar a retirada manual da semente com auxilio da peneira em água corrente. Deixar secar a sombra para a semeadura.",
#             132: " Colher frutos diretamente da árvore quando iniciarem a queda epontânea ou recolhê-los no chão logo após a queda. Em seguida, amontoá-los em saco plástico até iniciar o apodrecimento da polpa para facilitar a liberação da semente através da lavagem em água corrente.",
#             133: " Colher frutos diretamente da árvore quando iniciarem a queda epontânea ou recolhê-los no chão logo após a queda. Em seguida, amontoá-los em saco plástico até iniciar o apodrecimento da polpa para facilitar a liberação da semente através da lavagem em água corrente.",
#             134: ' A coleta deve ser do cacho, que devem ter muitos frutos "de vez". Este cacho deve ser colhido com facão e deixado secar a sombra para amadurecimento completo dos frutos. Após o amadurecimento, os frutos deve ser deixado de molho em agua para amolecer e retirada da semente para a semeadura e da polpa para consumo. 1 a 3 sementes por fruto.',
#             135: " Colher os frutos nos cachos quando atingem a coloração alaranjada. Podem ser coletados no chão, após a queda espontânea.",
#             136: " Colher os frutos nos cachos quando atingem a coloração alaranjada. Podem ser coletados no chão, após a queda espontânea.",
#             137: " Colher os frutos diretamente da árvore quando iniciarem a queda espontânea, ou recolhê-los no chão após a queda. Em seguida despolpar e deixar as sementes secarem a sombra. A despolpa pode ser feita após deixar os frutos amontoados por alguns dias para iniciar o processo de decomposição da polpa e facilitar a remoção das sementes, que serão lavadas e secadas à sombra, para colocar para germinar.",
