#             168: " Colher os frutos diretamente da árvore quando iniciarem a abertura e queda espontâneas. Em seguida deixá-los secar à sombra para completar sua abertura e liberação das sementes; que em seguida devem ser lavadas e secas para armazenamento e posterior semeadura.",
#             169: " Colher os frutos diretamente da árvore quando iniciarem a abertura e queda espontâneas. Em seguida deixá-los secar ao sol para completar sua abertura e liberação das sementes; que em seguida devem ser lavadas e secas para armazenamento e posterior semeadura.",
