#             171: " Colher os frutos diretamente da árvore quando iniciarem a queda espontânea, ou recolhê-los no chão, após queda. O fruto é bastante lenhoso, devendo ser triturado para a extração das sementes (Carvalho, 2003).",
#             172: " Colher os frutos quase maduros diretamente na planta ou no chão. Abrir manualmente para retirada das sementes e lavar em peneira com água corrente para remoção da polpa. A escarificação das sementes melhora a taxa de germinação.",
#             173: " Colher os frutos diretamente da árvore quando maduros, o que é facilmente notado pela presença de frutos danificados por animais. Depois, os frutos devem ficar em sacos plásticos por alguns dias até iniciar a decomposição e facilitar a despolpa em água corrente com peneira fina. Para separar as pequenas sementes, recomenda-se colocar esse material despolpado em um recipiente com água e aguardar a decantação das sementes.",
#             174: " Deixar os frutos amontoados para dar início a decomposição e facilitar sua maceração em água. Deve ser retirada a mucilagem que envolve a semente, por meio de lavagem e secagem ao sol.",
#             175: " Colher os frutos diretamente da árvore quando maduros, o que é facilmente notado pela presença de frutos danificados por animais. Depois, os frutos devem ficar em sacos plásticos por alguns dias até iniciar a decomposição e facilitar a despolpa em água corrente com peneira fina. Para separar as pequenas sementes, recomenda-se colocar esse material despolpado em um recipiente com água e aguardar a decantação das sementes.",
#             176: " Colher as espigas diretamente na árvore quando estivrem maduras, o que é notado quando apresentam sinais de consumo pela fauna. Despolpar manualmente em água corrente com peneira. Deixar as sementes secarem um pouco à sombra antes de semear.",
#             177: " Colher as espigas diretamente na árvore quando estivrem maduras, o que é notado quando apresentam sinais de consumo pela fauna. Despolpar manualmente em água corrente com peneira. Deixar as sementes secarem um pouco à sombra antes de semear.",
#             178: " Colher os frutos diretamente da árvore quando iniciarem a abertura espontânea. Em seguida levá-los ao sol para completar a abertura e liberação das sementes. Separar a asa para armazenamento e posterior semeadura.",
#             179: " Colher os frutos diretamente da árvore quando iniciarem a abertura espontânea. Em seguida levá-los ao sol para completar a abertura e liberação das sementes. Cobrir os frutos com uma tela fina para evitar que as sementes sejam levadas pelo vento.",
