#             204: " Como os frutos apresentam abertura explosiva, as vagens devem ser colhidas diretamente da árvore antes da abertura natural. Em seguida, devem ser expostas ao sol para secar e facilitar a abertura e a liberação das sementes.",
#             205: " Coletar os frutos diretamnete da árvore quando iniciarem a abertura espontânea. Em seguida, devem ser deixados secar à sombra para completar a abertura e facilitar a remoção das sementes. Não há necessidade de retirar o arilo que envolve as sementes, apenas deixar secar um pouco.",
