#             211: ' Colher os frutos diretamente da árvore quando iniciarem a queda espontânea. Este já podem ser considerados como "sementes" para fins de semeadura, uma vez que a remoção da verdadeira semente do seu interio é uma operação muito trabalhosa (Lorenzi, 1998b).',
#             212: " Os frutos devem ser coletados diretamente da árvore, quando iniciarem a abertura espontânea. Em seguida, devem ser expostos ao sol, para completarem a abertura e a liberação das sementes.",
#             213: " Colher os frutos diretamente da árvore quando iniciarem a abertura espontânea. Em seguida deixá-los ao sol para completar a abertura e a liberação das sementes.",
#             214: " Coletar os frutos diretamente da árvore quando iniciarem a abertura e a queda espontânea. Depois da coleta os frutos deverão se colocados em local ventilado e sombreado para total secagem e liberação do arilo aderente às sementes. Após esse procedimento deverão ser escarificadas no local oposto ao hilo.",
#             215: " Coletar os frutos diretamente da árvore quando iniciarem a abertura e a queda espontânea. Depois da coleta os frutos deverão se colocados em local ventilado e sombreado para total secagem e liberação do arilo aderente às sementes. Após esse procedimento deverão ser escarificadas no local oposto ao hilo.",
#             216: " Os frutos maduros (abertos ou semiabertos) devem ser colhidos diretamente da árvore antes da abertura completa. Em seguida, devem ser expostos ao sol para completar a abertura e a liberação das sementes. A polpa deve ser retirada da semente antes da semeadura. A semente possui dormência que pode ser quebrada com escarificação ácida.",
#             217: " Coletar os frutos diretamente da árvore quando iniciarem a abertura e a queda espontânea. Depois da coleta os frutos deverão se colocados em local ventilado e sombreado para total secagem e liberação do arilo aderente às sementes. Após esse procedimento deverão ser escarificadas no local oposto ao hilo.",
#             218: " Os frutos devem ser colhidos diretamente da árvore quando iniciarem a queda espontânea, ou serem colhidos no chão ao redor da árvore. Realizar a debulha (atrito) manual utilizando-se uma peneira de malha média, bem como retirar as sementes fora de padrão (separação no diafanoscópio e imersão em água). A água corrente acelera e otimiza o processo de germinação dessa espécie (Jorge et al., 2014).",
#             219: " Coletar os frutos maduros (coloração preta) na própria planta. Deve-se retirar a casca dos frutos e eliminar as sementes atacadas por insetos.",
#             220: " Colher os frutos (inflorescências secas) diretamente da árvore e deixá-las ao sol para secagem leve. Esfregar manualmente esse material para remoção dos restos florais. Como as verdadeiras sementes são difíceis de separar dos frutos secos, estes podem ser diretamente utilizados para a semeadura.",
#             221: " Colher os frutos diretamente da árvore quando apresentarem cor amarelada escura. Retirar as membranas que recobrem a semente. Pode ser propagada por estacas de galho e por estcas altas tipo mourão.",
#             222: " Colher os frutos (inflorescências secas) diretamente da árvore e deixá-las ao sol para secagem leve. Esfregar manualmente esse material para remoção dos restos florais. Como as verdadeiras sementes são difíceis de separar dos frutos secos, estes podem ser diretamente utilizados para a semeadura.",
#             223: " Colher os frutos (inflorescências secas) diretamente da árvore e deixá-las ao sol para secagem leve; isso facilita a remoção dos pedúnculos e aderentes através do esfregaço manual. Após esse preparo, o cálice permanece aderente ao fruto; não devendo ser retirado. Como as verdadeiras sementes não são separáveis dos frutos, estes devem ser diretamente utilizados para a semeadura.",
