#             600: " Colher os frutos (vagens) diretamente da árvore quando iniciarem a queda espontânea ou recolhê-los no chão sob a planta-mãe logo após a queda. Em seguida, abrí-los manualmente para a retirada das sementes. A sementes são duras e devem ser escarificadas mecânica ou quimicamente antes da semeadura para melhorar sua germinação (Lorenzi, 1998b).",
#             601: " Os frutos devem ser colhidos diretamente da árvore, quando iniciarem a abertura espontanea, em seguida devem ser expostos ao sol, para completa abertura e liberação de sementes. É necessário uma secagem prolongada para que se possa armazená-las. No caso, da semeadura imediata não há necessidade de secagem.",
#             602: " Colher os frutos diretamente da árvore quando iniciarem a abertura espontânea, o que é facilmente notado pela exposição da sementes envolta pelo arilo de cor branca. Em seguida levá-los ao sol para completar a abertura e liberação das sementes. Devido à suculência do arilo que envolve as sementes é necessário uma secagem prolongada para poder armazená-las. No caso, da semeadura imediata não há necessidade de secagem.",
#             603: " Colher os frutos diretamente da árvore quando iniciarem a abertura espontânea. Deixar ao sol para completar a abertura e liberação das sementes. Se for armazenar, recomenda-se desidratar a polpa. No caso da semeadura imediata não há necessidade de secagem.",
#             604: " Colher os frutos diretamente da árvore quando iniciarem a queda espontânea, ou recolher do chão. Não é necessário despolpa, ou frutos podem ser utilizados para semeadura.",
#             605: " Os frutos devem ser colhidos quando iniciarem abertura espontânea, depois devem ser levados ao sol, para completar abertura e em seguida proceder à retirada manual das sementes.",
#             606: " Colher os frutos diretamente da árvore quando iniciarem a abertura espontanea. Em seguida deixá-los ao sol para completarem sua abertura e a liberação das sementes. Coloca-las para germinar logo que colhidas.",
#             607: " Colher os frutos diretamente da árvore quando iniciarem a abertura espontânea. Em seguida deixá-los em local arejado para completarem a abertura e liberação das sementes. Retirar manualmente os aparatos de voo.",
#             608: " Colher os frutos diretamente da árvore quando iniciarem a abertura espontanea. Em seguida deixá-los ao sol para completarem sua abertura e a liberação das sementes. Coloca-las para germinar logo que colhidas.",
#             609: " Colher os frutos diretamente da árvore quando iniciarem a abertura espontânea. Em seguinda deixar os frutos em local arejado para completarem a secagem e abertura para liberação das sementes.",
#             610: " Colher os frutos diretamente da árvore quando maduros ou no chão. Deixar secar ao sol .",
#             611: " Os frutos devem ser colhidos diretamente da árvore ou recolhidos do chão. Os frutos podem ser semeados diretamente, visto que a retirada das sementes é muito difícil.",
#             612: " Colher os frutos diretamente na planta quando começarem a secar. Os frutos poderão ser usados diretamente para semeadura, pois é dificíl a separação da semente. Mergulhar os frutos durante breve período em água fervendo ajuda a acelerar a germinação.",
#             613: " Ao ser coletados sacudir os frutos para verificar a existência de sementes viáveis. Bater com martelo na quina do fruto sobre uma superficie dura para extração das sementes. As sementes devem ser lavadas com sabão e em seguida colcá-las para secar à sombra.",
#             614: " Ao ser coletados sacudir os frutos para verificar a existência de sementes viáveis. Bater com martelo na quina do fruto sobre uma superficie dura para extração das sementes. As sementes devem ser lavadas com sabão e em seguida colcá-las para secar à sombra.",
#             615: " Colher os frutos diretamente da árvore quando adquirem coloração paleácea. Pode-se semear as própias vagens como se fossem sementes. Entretanto, issso pode acarretar a formação de mudas defeituosas. Portanto sempre que possível é recomendável tirar as sementes das vagens. Essa operação é facilitada deixando-as ao sol para secar e posteriormente esfregando-as manualmente ou mecanicamente.",
#             616: " Os frutos devem ser colhidos diretamente da árvore quando iniciarem a abertura espontânea. Em seguida, levá-los ao sol para completar a abertura e liberação das sementes aladas. Em geral, as sementes mais escuras não são viáveis.",
#             617: " Os frutos devem ser colhidos diretamente da árvore quando iniciarem a abertura espontânea. Em seguida, levá-los ao sol para completar a abertura e liberação das sementes aladas. Em geral, as sementes mais escuras não são viáveis.",
#             618: " Colher os frutos diretamente da árvore quando iniciarem a abertura espontânea. Em seguida deixá-los em local arejado para completar a abertura e liberação das sementes. Retirar manualmente os aparatos de voo antes da semeadura.",
