#             622: " Colher os frutos diretamente da árvore quando apresentarem coloração escura. Em seguida retirar a casca do fruto utilizando uma peneira para fricção.",
#             623: " Em Rhizofora, segundo Rabinowits (1978), a viviparidade da planta mãe produz propágulos na forma de grandes hipocótilos. A queda dos propágulos ocasiona a separação dos cotilédones, e a fixação no substrato, que pode partir da posição vertical ou horizontal ou pode também flutuar e ser transportados para outros lugares. Para obtenção de sementes os frutos devem ser colhidos diretamente da árvore quando iniciarem a germinação, estando assim prontos para serem plantados diretamente no local definitivo",
