#             690: " Os frutos devem ser colhidos diretamente da árvore, quando iniciar a queda espontânea. Corta-se as infrutescências inteiras e batê-las sobre uma lona. Deixar os frutos alguns dias amontoados de repouso para facilitar a despolpa em água corrente.",
