#             696: " Colher os frutos diretamente da árvore quando apresentarem queda espontanea, em seguida deixar os frutos em água com hipoclorido (1%) durante 5 dias. Após esse período lavar os frutos com água pressurizada para completar a retirada da polpa. Deixar as sementes secarem durante 1 semana em local sombreado.",
