#             698: " Se dá por maceração, para remover o epicarpo e mesocarpo do fruto. Ou utilizar o fruto diretamente para semeadura.",
#             699: " Colher os frutos com estiverem roxos, deixar em água em temperatura ambiente por 12 a 24h para amolecer a polpa. Macerar os frutos sobre peneiras em água corrente, secar em ambiente ventilado.",
#             700: " Coleta as hastes com cabeças brancas (infrutescências) com a mão, segurando a planta com os pés para evitar coletar a planta toda. As cabeças brancas devem ser separadas do pendão e batidas em liquidificador para desagregar as sementes.",
#             701: " É recomendado que as sementes dessa espécie sejam extraídas de frutos quando esses iniciarem a abertura espontanea. Por sua vez, sementes colhidas no chão também apresentam qualidade fisiológica, podendo ser semeadas imediatamente após a colheita. Também pode-se coletar os frutos, quando iniciarem a abertura espontânea. Estes podem ser levados ao sol para facilitar a retirada manual da semente.",
#             702: " Os frutos devem ser colhidos diretamente da árvore quando os primeiros iniciarem sua abertura espontânea. Em seguida levá-los ao sol para completarem a abertura e liberação das sementes",
#             703: " É recomendado que as sementes dessa espécie sejam extraídas de frutos quando esses iniciarem a abertura espontanea. Por sua vez, sementes colhidas no chão também apresentam qualidade fisiológica, podendo ser semeadas imediatamente após a colheita. Também pode-se coletar os frutos, quando iniciarem a abertura espontânea. Estes podem ser levados ao sol para facilitar a retirada manual da semente.",
#             704: " Colher os frutos diretamente da árvore quando iniciar a abertura espontânea. Deixar secar a sombra pra completar a abertura do fruto",
#             705: " Colher os frutos diretamente da árvore quando iniciarem a abertura espontânea, o que pode ser facilmente observado pela exposição do arilo vermelho-vivo das sementes. Em seguida, deixá-los ao sol para completar a abertura; após a retirada das sementes, deixá-las secar a sombra. Não há necessidade de retirar o arilo mucilaginoso que envolve as sementes.",
#             706: ' Colher os frutos (vagens) diretamente da árvore quando adquirirem coloração palha e iniciarem a queda espontânea. Estes já podem ser considerados "sementes" para efeito de semeadura, porém a retirada da semente verdadeira, que é uma operação trabalhosa, permite escarificar química ou mecanicamente as sementes e assim melhorar significativamente a taxa de germinação.',
#             707: ' Colher os frutos (vagens) diretamente da árvore quando adquirirem coloração palha e iniciarem a queda espontânea. Estes já podem ser considerados "sementes" para efeito de semeadura, porém a retirada da semente verdadeira, que é uma operação trabalhosa, permite escarificar química ou mecanicamente as sementes e assim melhorar significativamente a taxa de germinação.',
#             708: ' Colher os frutos (vagens) diretamente da árvore quando adquirirem coloração palha e iniciarem a queda espontânea. Estes já podem ser considerados "sementes" para efeito de semeadura, porém a retirada da semente verdadeira, que é uma operação trabalhosa, permite escarificar química ou mecanicamente as sementes e assim melhorar significativamente a taxa de germinação.',
#             709: ' Colher os frutos (vagens) diretamente da árvore quando adquirirem coloração palha e iniciarem a queda espontânea. Estes já podem ser considerados "sementes" para efeito de semeadura, porém a retirada da semente verdadeira, que é uma operação trabalhosa, permite escarificar química ou mecanicamente as sementes e assim melhorar significativamente a taxa de germinação.',
#             710: ' Colher os frutos (vagens) diretamente da árvore quando adquirirem coloração palha e iniciarem a queda espontânea. Estes já podem ser considerados "sementes" para efeito de semeadura, porém a retirada da semente verdadeira, que é uma operação trabalhosa, permite escarificar química ou mecanicamente as sementes e assim melhorar significativamente a taxa de germinação. As sementes apresentam dormência.',
#             711: " Colher os frutos diretamente da árvore, quando iniciarem a queda espontânea. Em seguida, devem ser despolpados, manualmente, e lavados em água corrente, dentro de uma peneira. Após a separação das sementes, estas devem secar à sombra. Em seguida colocar as sementes para germinar.",
#             712: " Os frutos dessa espécie devem ser colhidos diretamente da árvore, quando iniciarem a queda espontânea. Em seguida, devem ser despolpados, manualmente, e lavados em água corrente, dentro de uma peneira. Após a separação das sementes, estas devem secar à sombra. Quando a semeadura é feita no próprio local, não há necessidade de se remover a polpa, semeando-se os próprios frutos, como se fossem sementes.",
#             713: " Colher os frutos quando estiverem roxos e iniciarem a queda espotânea. Os frutos podem ser colocados para germinar sem nenhum tratamento.",
#             714: " Coletar os frutos e despolpá-los através da friccção em peneira com o auxílio de água corrente.",
#             715: " Colher os frutos diretamente na árvore quando estiverem secos. Remover os aparatos de voo antes de semear para diminuir o volume no recipiente.",
#             716: " Os frutos devem ser colhidos diretamente da árvore, quando iniciarem a queda espontânea ou no chão após a queda. Recomenda-se colocar o fruto para germinar diretamente como se fossem sementes.",
#             717: " coletar os frutos diretamente da árvore quando adquirirem cor amarronzada",
#             718: " Os frutos devem ser colhidos diretamente da árvore, quando iniciarem a queda espontânea ou no chão após a queda. Recomenda-se colocar o fruto para germinar diretamente como se fossem sementes.",
#             719: " Colher os frutos diretamente na árvore quando estiverem maduros. Depois, despolpar manualmente as sementes em água corrente.",
#             720: " Colher os frutos diretamente na árvore quando estiverem maduros. Depois, despolpar manualmente as sementes em água corrente.",
#             721: " Colher os frutos diretamente na arvoreta quando maduros com coloração roxa. Remover a polpa dos frutos com peneira fina em água corrente para separar as pequenas sementes. Após, as sementes estarão prontas para semeadura.",
#             722: " Os frutos devem ser colhidos diretamente da árvore quando apresentarem coloração amarelada. Em seguida deixá-los amontoados em saco plástico até o apodrecimento parcial de sua polpa para facilitar a separação das sementes através da lavagem em água corrente.",
#             723: " Colher quando as inflorescências estiverem secas. O uso de ensiladeira pode ajudar na colheita.",
#             724: " Colher os frutos diretamente na árvore quando apresentarem coloração roxa ou no chão quando iniciarem a queda espontânea. Em seguida, deixá-los amontoados em saco plástico durante alguns dias até a decomposição parcial da polpa para facilitar a remoção da semente através da lavagem em água corrente.",
#             725: " Os frutos devem ser coletados quando atingem a coloração verde-vermelha a vermelha, em seguida devem ficar dois dias na água para facilitar a extração de sementes. O beneficiamento é feito através de maceração dos frutos em peneira. As sementes devem ser colocadas em peneiras e postas em ambiente ventilado para a secagem.",
#             726: " Colher os frutos diretamente da arvoreta quando iniciarem a abertura espontânea. Em seguida, deixá-los ao sol para completarem sua abertura e a liberação das minúsculas sementes.",
#             727: " Coleta dos pendões com foice de mão. Observar que as sementes devem estar dispersando (soltando naturalmente dos pendões). Os pendões são passados em máquina trituradora de palha (ensiladeira) para desagregação das sementes.",
#             728: " Os frutos devem ser colhidos diretamente da árvore quando iniciarem a abertura espontânea, cortando-se os ramos frutiferos e deixando os frutos secarem à sombra para completar a abetura e a liberação das sementes (Lorenzi, 2009).",
#             729: " Os frutos devem ser colhidos diretamente da árvore quando iniciarem a abertura espontânea, cortando-se os ramos frutiferos e deixando os frutos secarem à sombra para completar a abetura e a liberação das sementes.",
#             730: " Colher os frutos diretamente da árvore quando iniciarem a abertura espontânea, o que é facilmente notado pela exposição do arilo vermelho que envolve as sementes. Em seguida levá-los ao sol para completar a abertura e liberação das sementes. Não é necessário remover o arilo que envolve as sementes antes de semear, apenas deixar secar um pouco.",
#             731: "Sem esse dado.",
#             732: " Colher os frutos diretamente da árvore quando iniciarem a queda espontânea. Os frutos assim obtidos podem ser diretamente utilizados para a semeadura, não havendo necessidade de separar as sementes. Entretanto caso deseja-se reduzir o volume para efeito de remessa ou armazenamento pode-se deixá-los ao sol para secar e facilitar a retirada manual das sépalas e pericarpo. Colocar as sementes ou frutos para germinação.",
#             733: " Colher os frutos diretamente da árvore quando iniciarem a queda espontânea. Os frutos assim obtidos podem ser diretamente utilizados para a semeadura, não havendo necessidade de separar as sementes. Entretanto caso deseja-se reduzir o volume para efeito de remessa ou armazenamento pode-se deixá-los ao sol para secar e facilitar a retirada manual das sépalas e pericarpo. Colocar as sementes ou frutos para germinação.",
#             734: " Coleta dos pendões com foice de mão. Observar que as sementes devem estar dispersando (soltando naturalmente dos pendões). Os pendões são passados em máquina trituradora de palha (ensiladeira) para desagregação das sementes.",
#             735: " Colher os frutos diretamente na planta quando iniciarem a secagem. Em seguida deixá-los em local arejado para completar a abertura e liberação das sementes.",
#             736: "Sem esse dado.",
#             737: " As sementes que encontram-se na superfície do solo podem ser recolhidas manualmente e passadas em peneiras para a pré-limpeza no campo, e a realização da abanação (tecnica de limpeza).",
#             738: " colher os frutos diretamente da árvore quando iniciarem a abertura espontânea. Deixar no sol para completar a abertura e facilitar a retirada das sementes.",
#             739: " Colher os frutos (vagens) diretamente das plantas quando adquirirem coloração marrom ecura e iniciarem a queda espontânea. Em seguida deixá-los ao sol por alguns dias para facilitar sua abertura manual para a retirada das sementes.",
#             740: " Colher os frutos diretamente na árvore quando iniarem a abertura expontânea. Deixar no sol para completar a abertura e liberação das sementes.",
#             741: " Colher os frutos diretamente da árvore quando iniciarem a queda espontânea. Os frutos assim obtidos podem ser diretamente usados para semeadura.",
#             742: " Colher os frutos diretamente da árvore quando iniciarem processo de secagem. Em seguida deixá-los em local arejado para completarem a secagem. Remover manualmente o aparato de voo.",
