#             751: " Recolher os frutos no chão embaixo da árvore após sua queda espontânea. Em seguida, deixá-los amontoados em saco plástico durante alguns dias até a decomposição da polpa para facilitar a remoção da semente pela lavagem em água corrente (Lorenzi, 1998b).",
